// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import "../interfaces/IVaultInfoFacet.sol";
import "../interfaces/IVaultFacet.sol";
import "../utils/math/SafeMath.sol";


contract VaultInfoFacet is IVaultInfoFacet{
    using SafeMath for uint256;
    string constant private KEY_LOCK_PERIOD = "lock_period";

    function locks(address _user,uint256 _startIndex,uint256 _limit) external override view returns(LibDiamond.LockInfo[] memory locks_,uint256[] memory locksTopup){
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        uint256 userLocksCount_ = ds.userLocksCount[_user];

        if(_startIndex > userLocksCount_){
            locks_= new LibDiamond.LockInfo[](0);
        }else{
            uint256 count = userLocksCount_.sub(_startIndex);
            uint256 length;
            if(_limit >= count || _limit == 0){
                length = count;
            }else{
                length = _limit;
            }
            if(userLocksCount_ > 0) {
                locks_= new LibDiamond.LockInfo[](length);
                for (uint256 i = 0; i < length; i++) {
                    bytes32 key = keccak256(abi.encode(_user,_startIndex.add(i)));
                    locks_[i] = ds.locksMap[key];
                }
            }
        }
        uint256 _locksTopupLength = LibDiamond.getUint(keccak256(abi.encode(_user,"vfinix.TopUpFeature.lengthLockTopUp")));
        locksTopup = new uint256[](_locksTopupLength);
        for(uint256 i = 0; i < _locksTopupLength; i++){
            locksTopup[i] = LibDiamond.getUint(keccak256(abi.encode(msg.sender,i,"vfinix.TopUpFeature.isLockTopUpList")));
        }

    }



 function locksDesc(address _user,uint256 _startIndex,uint256 _limit) external override view returns(LibDiamond.LockInfo[] memory locks_,uint256[] memory locksTopup){
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        uint256 userLocksCount_ = ds.userLocksCount[_user];

        if(_startIndex > userLocksCount_){
            locks_= new LibDiamond.LockInfo[](0);
        }else{
            uint256 count = userLocksCount_.sub(_startIndex);
            uint256 length;
            if(_limit >= count || _limit == 0){
                length = count;
            }else{
                length = _limit;
            }
            if(userLocksCount_ > 0) {
                locks_= new LibDiamond.LockInfo[](length);
                for (uint256 i = 0; i < length; i++) {
                    bytes32 key = keccak256(abi.encode(_user,(userLocksCount_.sub(1)).sub(_startIndex).sub(i)));
                    locks_[i] = ds.locksMap[key];
                }
            }
        }
        uint256 _locksTopupLength = LibDiamond.getUint(keccak256(abi.encode(_user,"vfinix.TopUpFeature.lengthLockTopUp")));
        locksTopup = new uint256[](_locksTopupLength);
        for(uint256 i = 0; i < _locksTopupLength; i++){
            locksTopup[i] = LibDiamond.getUint(keccak256(abi.encode(msg.sender,i,"vfinix.TopUpFeature.isLockTopUpList")));
        }
    }


    function getLockMap(bytes32 key) external override view returns(LibDiamond.LockInfo memory lockInfo_) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        lockInfo_ = ds.locksMap[key];
    }


    function lockInfo(address _user,uint256 _lockIndex) external override view returns(LibDiamond.LockInfo memory lockInfo_){
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        bytes32 key = keccak256(abi.encode(_user,_lockIndex));
        lockInfo_ = ds.locksMap[key];
    }

    function lockSafeToUnlock(address _user, uint256 _lockIndex) external override view returns (bool) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();

        // Get Lock info
        bytes32 key = keccak256(abi.encode(_user, _lockIndex));
        LibDiamond.LockInfo storage lockInfo_ = ds.locksMap[key];

        // Check ending period
        (uint256 period_, , , , ,) = IVaultFacet(address(this)).getLockPeriod(lockInfo_.level);

        if (block.timestamp < lockInfo_.lockTimestamp + period_) {
            return false;
        }
        return true;
    }

    function getUserLockAmount(address _user) external override view returns(uint256) {
        LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
        return ds.userLocksAmount[_user];
    }
     function getAllLockPeriods () external override view returns(
            LibDiamond.ParamLockPeriods memory param_
        ) {

        param_._period1 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"period")));
        param_._multiplier1 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"multiplier")));
        param_._minimum1 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"minimum")));
        param_._penaltyPeriod1 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"penaltyPeriod")));
        param_._penaltyRate1 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"penaltyRate")));
        param_._penaltyRateDecimal1 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level1,"penaltyRateDecimal")));

        param_._period2 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"period")));
        param_._multiplier2 =LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"multiplier")));
        param_._minimum2 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"minimum")));
        param_._penaltyPeriod2 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"penaltyPeriod")));
        param_._penaltyRate2 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"penaltyRate")));
        param_._penaltyRateDecimal2 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level2,"penaltyRateDecimal")));

        param_._period3 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"period")));
        param_._multiplier3 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"multiplier")));
        param_._minimum3 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"minimum")));
        param_._penaltyPeriod3 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"penaltyPeriod")));
        param_._penaltyRate3 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"penaltyRate")));
        param_._penaltyRateDecimal3 = LibDiamond.getUint(keccak256(abi.encodePacked(KEY_LOCK_PERIOD,LibDiamond.LockLevel.Level3,"penaltyRateDecimal")));
    }

}
